void Rogue_trace()
{
  void* link;
  int i;

  // Trace GLOBAL PROPERTIES
  if ((link=RogueStringBuilder_work_bytes)) ((RogueObject*)link)->type->trace_fn( link );
  if ((link=RogueRuntime_type_info_lookup)) ((RogueObject*)link)->type->trace_fn( link );
  if ((link=RoguePlasmacore__Display__default_view_type)) ((RogueObject*)link)->type->trace_fn( link );
  if ((link=RoguePlasmacore__Image_search_folders)) ((RogueObject*)link)->type->trace_fn( link );
  if ((link=RoguePlasmacore__Bitmap_resize_row_buffer)) ((RogueObject*)link)->type->trace_fn( link );
  if ((link=RogueSystem_command_line_arguments)) ((RogueObject*)link)->type->trace_fn( link );
  if ((link=RogueSystem_executable_filepath)) ((RogueObject*)link)->type->trace_fn( link );
  if ((link=RogueLogicalValue_true_value)) ((RogueObject*)link)->type->trace_fn( link );
  if ((link=RogueLogicalValue_false_value)) ((RogueObject*)link)->type->trace_fn( link );
  if ((link=RogueStringValue_empty_string)) ((RogueObject*)link)->type->trace_fn( link );
  if ((link=RogueJSONParser_buffer)) ((RogueObject*)link)->type->trace_fn( link );
  if ((link=RoguePlasmacore__SystemFontData_png_data)) ((RogueObject*)link)->type->trace_fn( link );
  if ((link=RoguePlasmacore__Anchor_lookup)) ((RogueObject*)link)->type->trace_fn( link );

  // Trace Class objects and singletons
  for (i=Rogue_type_count; --i>=0; )
  {
    RogueType* type = &Rogue_types[i];
    if (type->type_info) RogueTypeInfo_trace( type->type_info );
    if (type->_singleton) type->trace_fn( type->_singleton );
  }
}

