void Rogue_launch()
{
  RogueStringBuilder__init_class();
  RogueRuntime__init_class();
  RoguePlasmacore__Display__init_class();
  RoguePlasmacore__Image__init_class();
  RoguePlasmacore__Bitmap__init_class();
  RogueSystem__init_class();
  RogueLogicalValue__init_class();
  RogueStringValue__init_class();
  RogueJSONParser__init_class();
  RoguePlasmacore__SystemFontData__init_class();
  RoguePlasmacore__Anchor__init_class();

  RogueSystem_executable_filepath = RogueString_create_from_utf8(
      Rogue_argc ? Rogue_argv[0] : "Rogue", -1 );
  
  for (int i=1; i<Rogue_argc; ++i)
  {
    RogueString_List__add__String( RogueSystem_command_line_arguments,
        RogueString_create_from_utf8( Rogue_argv[i], -1 ) );
  }

  // Instantiate essential singletons
  ROGUE_SINGLETON( Global );
  ROGUE_SINGLETON( Plasmacore__MessageManager );
  ROGUE_SINGLETON( Plasmacore__Plasmacore );
  ROGUE_SINGLETON( TaskManager );
  ROGUE_SINGLETON( Plasmacore__OverlayLog );
  ROGUE_SINGLETON( Plasmacore__WindowManager );

  RogueGlobal__on_launch( (RogueClassGlobal*) (RogueType_singleton(RogueTypeGlobal)) );
  Rogue_collect_garbage();
}

bool Rogue_update_tasks()
{
  // Returns true if any tasks are still active
  try
  {
    RogueClassTaskManager* task_manager = (RogueClassTaskManager*) ROGUE_SINGLETON(TaskManager);
    bool result = RogueTaskManager__update( task_manager );
    Rogue_collect_garbage();
    return result;
  }
  catch (RogueException* err)
  {
    printf( "Uncaught exception\n" );
    RogueException__display( err );
    return false;
  }
}
